            if(j < i) {
                if(mat[i][j] > najgolem) {
                    najgolem = mat[i][j];
                }
            }
            if(j > n - i - 1) {
                if(mat[i][j] < najmal) {
                    najmal = mat[i][j];
                }
            }
        }
    }
    printf("%d %d\n", najgolem, najmal);
    return 0;
}

